INSERT INTO `mf_system_text` VALUES (1,'Православие','',''),(2,'Посты и трапезы','',''),(3,'Посты','',''),(4,'Великие Праздники','',''),(5,'Мясоеды','',''),(6,'Сплошные седмицы','',''),(7,'Пасха','','Главный праздник богослужебного года. Установлен в честь воскресения Иисуса Христа. В Пасху, как в важнейший праздник церковного года, совершается особо торжественное богослужение. В Церкви с древних времён сложилась традиция совершения Пасхального богослужения ночью. \r\nНачиная с пасхальной ночи и последующие сорок дней (до отдания Пасхи) принято христосоваться, то есть приветствовать друг друга словами: «Христос воскресе!» — «Воистину воскресе!», при этом троекратно целуясь. \r\nНепосредственно перед Пасхой православные собираются в храме, откуда начинается крестный ход с громким пением стихиры праздника. К полуночи шествие подходит к дверям храма и начинается богослужение пасхальной утрени.'),(8,'Рождество Богородицы','','Православные вспоминают в этот день события связанные с рождением Богородицы. На любом богослужении восхваляется Пречистая Дева Мария, удостоившаяся быть Матерью Спасителя нашего Иисуса Христа, и упоминается о родителях Ее, святых Иоакиме и Анне.'),(9,'Воздвижение креста господня.','','Праздник Воздвижения Животворящего Креста Господня установлен в память обретения и воздвижения Креста Христова. По традиции в этот день принято надевать облачения фиолетового цвета. В день Воздвижения разрешается употреблять пищу с растительным маслом (молочное, яйца и рыбу есть нельзя). \r\nВ кафедральных соборах и крупных храмах совершается чин воздвижения Креста: епископ или старший священник при произнесении молитвенных прошений и пений \"господи, помилуй\" воздвигает Крест, осеняя им верующих. Затем поется кондак Воздвижения, и все творят поклонение Кресту с пением \"Кресту Твоему поклоняемся, Владыко, и святое Воскресение Твое славим!\".'),(10,'Введение во храм Пресвятой Богородицы','Печатный станок являл собой массивное сооружение, прикрепленное брусьями к полу и потолку. Главной его частью был пресс с рычагом, под которым находился плоский стол - талер. Этот талер был устроен так, что мог выдвигаться из-под пресса. На талер ставили набор двух или нескольких страниц (до 32), сколько их помещалось в зависимости от размера. Краской смазывали все выпуклые части набора. Чтобы бумага при печатании не соскальзывала с набора, использовали специальное приспособление - декель, снабженный двумя или тремя остриями (графейками). Он прикреплялся к передней части талера на шарнирах. Перед началом печатания мастер брал несколько листов бумаги (10-20), тщательно выравнивал их по краям и нанизывал на графейки. Сверху эти листы прикрывались рамкой (рашкетом), которая крепилась к декелю также на шарнирах. Рашкет закрывал поля бумаги и середину листа, то есть все части, которые должны были оставаться чистыми. После этого декель опускался на набор, так что нижний лист плотно прижимался к набору. Талер подвигали под пресс и при помощи рычага прижимали пиан (верхнюю доску) к декелю. Затем пресс поднимали, выдвигали весь аппарат с бумагой, поднимали рашкет и снимали с графеек напечатанный лист. Для того чтобы получить лучший оттиск, бумагу слегка смачивали водой. Поэтому готовые листы просушивали на веревке. После сушки делали оттиск на другой стороне листа. Затем листы поступали к переплетчику.','Нужно помнить, что наше спасение, наше искупление воплотившимся Сыном Божиим стало возможно потому, что избранная послужить для этого Пречистая Богородица была введена своими родителями в храм Божий и получила воспитание при храме. Этот поступок родителей Марии церковь ставит в пример всем верующим, указывая, что истинные христиане должны воспитывать в своих детях любовь к Всевышнему с самого раннего возраста, как только ребенок начинает понимать окружающее.'),(11,'Рождество христово','','В этот день православные вспоминают события связанные с появлением на свет Христа. Рождество Христово завершает сорокадневный Рождественский пост, а последующие святки наполнены праздничным настроением о рождении спасителя. В праздник Рождества Христова православные приветствуют друг друга словами: «Христос родился!», отвечая на них - «Славим Его!».  '),(12,'Крещение Господне','','Праздник отмечается в честь крещения Иисуса Христа в реке Иордан Иоанном Крестителем. В память того, что Спаситель Своим Крещением освятил воду, бывает водосвятие; накануне праздника вода освящается в храмах, в самый же праздник Богоявления — в реках или других местах, где берут воду. В этот день православные окунаются в воду или обливаются святой водой, очищаясь не только телесно, но и духовно.'),(13,'Сретение Господне','','Этот праздник установлен в память о встрече, описанной в Евангелии от Луки, которая произошла на сороковой день после Рождества Христова, когда Дева Мария и праведный Иосиф Обручник принесли Младенца в Иерусалимский храм, чтобы совершить благодарственную жертву Богу.'),(14,'Благовещение Пресвятой Богородицы','','Этот праздник дает нам лишний раз вспомнить о возвещении Архангелом Гавриилом Пресвятой Марии, что она зачала Богомладенца и вскоре родит спасителя всего мира.\r\n\r\nВ праздник устав разрешает употребление в пищу рыбы, вина и елея. С Благовещением в народе связаны некоторые старинные обычаи. Говорят, что в Благовещение \"птица гнезда не вьет, девица косы не плетет\", то есть всякая работа считается грехом.'),(15,'Вход Господень в Иерусалим (Вербное Воскресенье)','','В этот день Церковь вспоминает, что пришедшие на праздник Пасхи иудеи встречали Иисуса как мессию, как пророка, как великого чудотворца, ибо знали, что Он незадолго до этого воскресил четверодневного Лазаря.\r\nУ православных есть обычай хранить освящённые вербы в течение всего года, украшать ими иконы в доме. В этот праздничный день, несмотря на продолжающийся Великий пост, разрешается вкушение рыбных блюд.'),(16,'Вознесение Господне','','Православная Церковь вспоминает в этот день евангельские события связанные с последним моментом пребывания Христа на земле по Его Светлом Воскресении. Этот день нужно проводить в праздности - воспрещается любая работа.'),(17,'День святой троицы (пятидесятница)','','В праздник Пятидесятницы вспоминается и прославляется сошествие на апостолов Святого Духа. В этот день принято размышлять о триединстве Бога - Отца, Сына и Святого Духа.\r\n\r\nПо русской традиции, пол храма (и домов верующих) в этот день устилается свежескошенной травой, иконы украшаются берёзовыми ветвями, а цвет облачений — зелёный, изображающий животворящую и обновляющую силу Святого Духа (в других православных Церквах употребляются также облачения белого и золотого цветов).'),(18,' Преображение Господне (Яблочный спас)','','Принадлежит к числу двунадесятых великих праздников. В праздник совершается литургия, читаются паримии, а также поётся канон, в котором подчёркивается величие Преображения. Цвет богослужебных одежд в этот праздник — белый, символизирующий в этот день божественный нетварный фаворский свет. Праздник приходится на Успенский пост.\r\n\r\nВ русской народной традиции Преображение называется Вторым Спасом или Яблочным Спасом. Народное название праздник приобрёл по причине того, что, согласно Типикону, в этот день освящается виноград нового урожая и другие плоды, а там, где его нет, — яблоки, после чего их разрешается употреблять в пищу. Освящение проводится в конце праздничной литургии и является выражением дара Богу от благословлённой Им природы.'),(19,'Успение Пресвятой Богородицы.','','Двунадесятый праздник, посвящённый воспоминанию смерти Божией Матери. К смерти православным церковь рекомендует относится, как о способе соединится с теми, кто уже покинул этот мир. Этому празднику предшествует двухнедельный пост, что заставляет с особой осознанностью  задуматься о жизни после смерти и молитвами обратиться к Пресвятой Богородице для помощи в этом мире.'),(20,'Покров Пресвятой Богородицы','','Великий православный праздник, вобравший в себя много из народных суеверий.  Православным же не следует обращать на народные языческие традиции, а помнить что Пресвятая Богородица всегда защищала верующих и молилась о них и нам нужно молится и спрашивать у Царицы Небесной защиты и помощи. '),(21,'Обрезание Господне','','Господь принял обрезание, чтобы показать людям пример  исполнения Божественных установлений и чтобы никто впоследствии не мог усомниться в том, что Он был истинным Человеком, а не носителем призрачной плоти, как учили некоторые еретики.\r\nВ этот день православные вспоминают обрезаение господня и размышляют над символичностью этого события. '),(22,'Рождество Иоанна Предтечи','','Пророк Иоанн Креститель – самый чтимый святой после Девы Марии. Он именуется Иоанн Предтеча, поскольку является предшественником Иисуса. В этот день православные вспоминают житие Иоанна Предтечи. С праздником Иоанна Предтечи связан языческий праздник Ивана Купала - день летнего солнцестояния. '),(23,'День апостолов Петра и Павла.','Православные празднуют память святых апостолов Петра и Павла. Апостолы Петр и Павел более других потрудились в проповеди христианства среди иудеев и язычников, поэтому Церковь называет их \"первоверховными апостолами\".','Православные празднуют память святых апостолов Петра и Павла. Апостолы Петр и Павел более других потрудились в проповеди христианства среди иудеев и язычников, поэтому Церковь называет их \"первоверховными апостолами\". День посвящен воспоминаниям жития апостолов. '),(24,'Усекновение главы иоанна Предтечи','В этот день православные вспоминают святого Иоанна Крестителя. В память усекновения главы святого Иоанна  Церковью установлен праздник и строгий пост как выражение скорби христиан о насильственной смерти великого Пророка.','В этот день православные вспоминают святого Иоанна Крестителя. В память усекновения главы святого Иоанна  Церковью установлен праздник и строгий пост как выражение скорби христиан о насильственной смерти великого Пророка.'),(25,'рождественский пост','',''),(26,'Рождественский пост','Рождественский Пост длится сорок дней и установлен для очищения души и тела перед светлым праздником Рождества, чтобы следовать учению Христа в новом году.<br/>\r\nРождественский пост менее строгий, чем Великий и Успенский, во время поста не употребляют мясо, сливочное масло, молоко, яйца, сыр. <br/> \r\nВажно помнить, что пост - прежде всего не диета, а духовная работа над всей своей сущностью. В пост следует ограничить себя в том, что вызывает яркие эмоции, например посещение увеселительных мест, просмотр сериалов, чтение праздной литературы, отношения с противоположным полом. Пост - это жертва, которую верующие приносят для очищения. Степень ограничения себя зависит от личного решения - здесь нет критериев, лишь внутренний уровень духовных усилий.','Рождественский Пост длится сорок дней и установлен для очищения души и тела перед светлым праздником Рождества, чтобы следовать учению Христа в новом году.\r\nРождественский пост менее строгий, чем Великий и Успенский, во время поста не употребляют мясо, сливочное масло, молоко, яйца, сыр.\r\nВажно помнить, что пост - прежде всего не диета, а духовная работа над всей своей сущностью. В пост следует ограничить себя в том, что вызывает яркие эмоции, например посещение увеселительных мест, просмотр сериалов, чтение праздной литературы, отношения с противоположным полом. Пост - это жертва, которую верующие приносят для очищения. Степень ограничения себя зависит от личного решения - здесь нет критериев, лишь внутренний уровень духовных усилий.'),(27,'Великий Пост (Четыредесятница)','Великий Пост является важнейшим и самым древним постом в православной традиции, это время молитвы и покаяния. Во все протяжение Поста - 7 недель перед Пасхой - Церковью предписывается воздержание от скоромной пищи, мирских радостей и плотских утех.Особенно строгие предписания касаются первой и Страстной седмиц.<br/>\r\nВ постование следует входить постепенно, каждый человек определяет лично для себя количество необходимой ему пищи и питья. Церковь не призывает к Посту людей больных, детей до 14 лет, беременных женщин, военнослужащих по призыву.<br/>\r\nТакже стоит помнить, что пост должен быть не только телесным, но и духовным. Иначе он становится просто диетой.\r\n\r\n\r\n\r\n\r\n','Великий Пост является важнейшим и самым древним постом в православной традиции, это время молитвы и покаяния. Во все протяжение Поста - 7 недель перед Пасхой - Церковью предписывается воздержание от скоромной пищи, мирских радостей и плотских утех.Особенно строгие предписания касаются первой и Страстной седмиц.\r\nВ постование следует входить постепенно, каждый человек определяет лично для себя количество необходимой ему пищи и питья. Церковь не призывает к Посту людей больных, детей до 14 лет, беременных женщин, военнослужащих по призыву.\r\nТакже стоит помнить, что пост должен быть не только телесным, но и духовным. Иначе он становится просто диетой.'),(28,'Петров пост.','Петров пост (Апо́стольский пост, «Петровки», «Петрово говение»), - пост, установленный в память о святых апостолах Петре и Павле, которые постились, готовя себя дляевангельской проповеди. В эти дни постятся, подражая апостолам, чью память мы и будем праздновать в конце поста -12 июля. По типикону в течение всего Петрова поста полагается: по понедельникам, средам и пятницам — сухоядение один раз в день, по вторникам и четвергам — два раза вареная пища без масла, по субботам и воскресеньям — два раза вареная пища с маслом (растительным) и рыба.','Петров пост (Апостольский пост, «Петровки», «Петрово говение»), - пост, установленный в память о святых апостолах Петре и Павле, которые постились, готовя себя дляевангельской проповеди. В эти дни постятся, подражая апостолам, чью память мы и будем праздновать в конце поста - 12 июля. По типикону в течение всего Петрова поста полагается: по понедельникам, средам и пятницам — сухоядение один раз в день, по вторникам и четвергам — два раза вареная пища без масла, по субботам и воскресеньям — два раза вареная пища с маслом (растительным) и рыба.'),(29,'Успенский пост.','Успенский пост установлен в честь Пресвятой Богородицы. Божия Матерь, готовясь отойти в вечную жизнь, постилась и молилась. Так и нам, слабым и немощным (духовно и физически), тем более следует прибегать к посту, обращаясь к Пресвятой Деве за помощью во всякой нужде и молитве.  Как и во время любого православного поста, в Успенский пост важно не только телесное воздержание, но и духовное. Нужно стараться не предаваться шумным развлечениям, не ссориться. Успенский пост относится к строгим постам, что подразумевает более глубокую внутреннюю работу над своим состоянием, поведением. По типикону Понедельник, среда, пятница - сухоядение. Вторник, четверг - горячая пища без масла. В субботу и воскресенье разрешается пища с растительным маслом. ','Успенский пост установлен в честь Пресвятой Богородицы. Божия Матерь, готовясь отойти в вечную жизнь, постилась и молилась. Так и нам, слабым и немощным (духовно и физически), тем более следует прибегать к посту, обращаясь к Пресвятой Деве за помощью во всякой нужде и молитве.  Как и во время любого православного поста, в Успенский пост важно не только телесное воздержание, но и духовное. Нужно стараться не предаваться шумным развлечениям, не ссориться. Успенский пост относится к строгим постам, что подразумевает более глубокую внутреннюю работу над своим состоянием, поведением. По Типикону, понедельник, среда, пятница - сухоядение. Вторник, четверг - горячая пища без масла. В субботу и воскресенье разрешается пища с растительным маслом. '),(30,'Осенний мясоед','Осенний мясоед - период после успенского поста, когда можно есть мясо. Так же это время отдыха от полевых работ — традиционно связан с празднованием свадеб. В летний и осенний мясоеды среда и пятница - дни строгого поста. ','Осенний мясоед - период после успенского поста, когда можно есть мясо. Так же это время отдыха от полевых работ — традиционно связан с празднованием свадеб. В летний и осенний мясоеды среда и пятница - дни строгого поста. '),(31,'Осенний мясоед','',''),(32,'Зимний мясоед','Мясоед - период, в который разрешается есть мясо, кроме особых дней и поста по средам и пятницам. Зимний мясоед начинается с Рождества и продолжается до Масленицы. Так же это время свадеб и венчаний, поэтому этот период носит название \"свадебник\".','Мясоед - период, в который разрешается есть мясо, кроме особых дней и поста по средам и пятницам. Зимний мясоед начинается с Рождества и продолжается до Масленицы. Так же это время свадеб и венчаний, поэтому этот период носит название \"свадебник\". Свадьбы старались сыграть до пестрой недели, потому как в народе пестрая неделя считалась неблагоприятным временем для венчаний.'),(33,'Весенний мясоед','',''),(34,'Весенний мясоед','Весенний мясоед - период после великого поста, когда можно есть мясо. По средам и пятницам разрешается рыба.','Весенний мясоед - период в летнее время между и Великим и Петровом постом. В этот период разрешается употребление мяса, а по средам и пятницам – употребление рыбы.'),(35,'Летний мясоед','Период, когда по уставу православной церкви разрешается мясная пища','Летний мясоед - период, когда по уставу православной церкви разрешается мясная пища начинается 12 июля, когда празднуется день святых Петра и Павла, и продолжается до 13 августа. Если праздник святых Петра и Павла не приходится на среду и пятницу, разговляются мясом, в другие дни — рыбой, а мясо начинают есть со следующего дня — 13 июля, когда отмечается Собор двенадцати апостолов.\r\n'),(36,'Святки.','Двенадцать святых дней праздника Рождества Христова, до праздника Богоявления. Знаменует переход от старого сельскохозяйственного года к новому. Святки это время когда народ славит Рождество и милосердие Господа, пославшего на Землю Иисуса Христа.','Двенадцать святых дней праздника Рождества Христова, до праздника Богоявления. Знаменует переход от старого сельскохозяйственного года к новому. Святки это время когда народ славит Рождество и милосердие Господа, пославшего на Землю Иисуса Христа.'),(37,'Седмица мытаря и фарисея.','Снимается ограничение постом в среду и пятницу. Это подготовительная неделя к Великому посту. Подготовка осуществляется через осмысление своей совести и поступков своих. Притчею о мытаре и фарисее церковь внушает нам, что самый верный путь к очищению сердца есть уничтожение в себе фарисейского самомнения и укоренение в сердце мытаревого покаянного вопля: «Боже, милостив буди мне, грешному!» - говорит святитель Феофан Затворник. \r\n','В эту седмицу снимается ограничение постом в среду и пятницу. Это подготовительная неделя к Великому посту. Подготовка осуществляется через осмысление своей совести и поступков своих. Притчею о мытаре и фарисее церковь внушает нам, что самый верный путь к очищению сердца есть уничтожение в себе фарисейского самомнения и укоренение в сердце мытаревого покаянного вопля: «Боже, милостив буди мне, грешному!» '),(38,'Седмица сырная (Масленица)','Масленица, седмица сырная — неделя, предшествующая Великому посту; в это время по Уставу не разрешается употребление мяса, но разрешается употребление молочных продуктов (в том числе и масла), рыбы и яиц. В течении недели пекут блины. \r\n','Масленица, седмица сырная — неделя, предшествующая Великому посту; в это время по Уставу не разрешается употребление мяса, но разрешается употребление молочных продуктов (в том числе и масла), рыбы и яиц. В течении недели пекут блины. \r\nСмысл Сырной седмицы— примирение с ближними, прощение обид, подготовка к Великому посту, \"начало умиления и покаяния\" — время, которое нужно посвятить доброму общению с ближними, родными, друзьями, благотворению.\r\nВ народе каждый день Седмицы имел свое название и значения. Понедельник - встреча, вторник - заигрыш, среда - лакомки, четверг - разгуляй , пятница - тещины вечерки, суббота - золовкины посиделки, воскресенье - проводы, Прощеный день, целовальник. Однако, стоит помнить, что в данном случае русские народные гулянья с размахом и чревоугодием скорее противоречат духу Церкви, которая проповедует сдержанность - для воцерквленного человека Сырная Седмица должна быть пронизана духом покаяния и подготовки к подвигу поста. Завершив Седмицу Прощеным воскресеньем, он идет далее внутренне обновленным и очищенным.\r\n'),(39,'Пасхальная седмица','С апостольских времен праздник христианской Пасхи продолжается семь дней, то есть всю неделю и поэтому эта неделя называется \"Светлая Пасхальная Седмица\". Каждый день недели тоже называется светлым - Светлый Понедельник, Светлый Вторник и т. д., а последний день - Светлая Суббота. В эти дни православные красят яйца и дарят друг другу. Так же в эти дни на столах у христиан подаются освященные куличи и пасхи. Поста во время Светлой седмицы нет. Так же запрещено самовольно налагать на себя пост.','Эта неделя называется \"Светлая Пасхальная Седмица\", каждый день недели тоже называется светлым - Светлый Понедельник, Светлый Вторник и т. д., а последний день - Светлая Суббота. В эти дни православные красят яйца и дарят друг другу. Поста во время Светлой седмицы нет. Так же запрещено самовольно налагать на себя пост.\r\nВсю Светлую седмицу около открытых Царских врат стоит особый хлеб, называемый артос. В Субботу после литургии артос торжественно благословляется. После кусочки раздаются верующим. Молящиеся, получив часть артоса, сохраняют ее в течение всего года.\r\nВесь этот период (40 дней после Пасхи) считается Пасхальным периодом, и православные приветствуют друг друга приветствием \"Христос Воскресе! \" и ответом \"Воистину Воскресе!\"'),(40,'Троицкая седмица.','Седмица после праздника Троицы. Снимается ограничение на пост в среду и пятницу.','Седмица после праздника Троицы. Снимается ограничение на пост в среду и пятницу. Ранее на руси троицкая седмица именовалась зелеными святками - тогда еще языческим праздником. Это своего рода календарный рубеж между весной и летом. '),(1014,'Дни четырдясятныцы','',''),(1015,'Неделя мытаря и фарисея.','Неделя о мытаре и фарисее – первый из четырех воскресный день, с которого начинается приготовление верующих к началу Великого поста. За литургией читается соответствующая притча.','Неделя о мытаре и фарисее – первый из четырех воскресный день, с которого начинается приготовление верующих к началу Великого поста. За литургией читается соответствующая притча.'),(1016,'Неделя о блудном сыне.','Второе приготовительное к Великому посту воскресенье именуется Церковью Неделей о блудном сыне. За литургией читается соответствующая притча.','Второе приготовительное к Великому посту воскресенье именуется Церковью Неделей о блудном сыне. За литургией читается соответствующая притча.'),(1017,'Мясопустная вселенская родительская суббота','Суббота перед неделей мясопустной (о страшном суде). Эту субботу Церковь посвящает поминовению всех усопших от Адама до наших дней. Торжественное всецерковное поминовение усопших в эту субботу (а также в Троицкую субботу) приносит великую пользу и помощь умершим отцам и братиям нашим и вместе с тем служит выражением полноты церковной жизни, которой мы живем. Ибо спасение возможно только в Церкви — сообществе верующих, членами которого являются не только живущие, но и все умершие в вере. И общение с ними чрез молитву, молитвенное их поминовение и есть выражение нашего общего единства в Церкви Христовой. В этот день очень важно придти в храм Божий к началу Божественной литургии, подать записку с именами усопших и помолиться о их упокоении, или хотя бы поставить свечку.','Суббота перед неделей мясопустной (о страшном суде). Эту субботу Церковь посвящает поминовению всех усопших от Адама до наших дней. Торжественное всецерковное поминовение усопших в эту субботу (а также в Троицкую субботу) приносит великую пользу и помощь умершим отцам и братиям нашим и вместе с тем служит выражением полноты церковной жизни, которой мы живем. В этот день очень важно придти в храм Божий к началу Божественной литургии, подать записку с именами усопших и помолиться о их упокоении, или хотя бы поставить свечку.'),(1018,'Неделя о Страшном суде.','Мясопустная Неделя (воскресенье) посвящена напоминанию о всеобщем последнем и Страшном суде живых и мертвых. Заговенье на мясо - последний день когда позволяется употребление скоромной пищи. ','Мясопустная Неделя (воскресенье) посвящена напоминанию о всеобщем последнем и Страшном суде живых и мертвых. Заговенье на мясо - последний день когда позволяется употребление скоромной пищи. \r\nЭтот воскресный день также является одним из подготовительных к Великому посту, надлежит в него размышлять о начале и конце человечества и истории мира в том виде, в каком явлены они нашему человеческому опыту и восприятию: это, предпоследнее перед Постом воскресенье, погружает наше сознание в последние события истории человечества: второе пришествие на землю Иисуса Христа — судить живых и мертвых.\r\n'),(1019,'Неделя сыропустная (Адамово изгнание из Рая, Прощеное воскресенье).','В это воскресенье на Литургии читается библейское повествование об Адаме и Еве, злоупотребивших даром свободной воли и нарушивших божественную заповедь послушания. Также читается Евангельское повествование, в котором Господь Иисус Христос поясняет содержание молитвы “Отче наш”: “Если не будете прощать людям согрешения их, то и Отец ваш не простит вам согрешений ваших”. В Прощеное воскресенье Церковь дает наставления верующим относительно правильного поведения во время Великого поста и призывает прихожан покаяться друг перед другом во всех обидах и грехах, помириться и простить все накопившееся.','В это воскресенье на Литургии читается библейское повествование об Адаме и Еве, злоупотребивших даром свободной воли и нарушивших божественную заповедь послушания. Также читается Евангельское повествование, в котором Господь Иисус Христос поясняет содержание молитвы “Отче наш”: “Если не будете прощать людям согрешения их, то и Отец ваш не простит вам согрешений ваших”. В Прощеное воскресенье Церковь дает наставления верующим относительно правильного поведения во время Великого поста и призывает прихожан покаяться друг перед другом во всех обидах и грехах, помириться и простить все накопившееся. \r\nПолагается в этот день посещать могилы родных и друзей, дабы еще раз попросить прошения и у них. С этого момента верующие должны строго соблюдать чистоту телесную и душевную и впредь уже никого не осуждать.\r\n'),(1020,'Торжество православия','Праздник отмечаемый в воскресенье первой недели Великого поста. Праздник посвящен памяти победы православия над иконоборцами.  Во время этого праздника выставляются, в середине храма полукругом, на аналоях (высокие столики для икон) храмовые иконы. В этот день церковь анафематствует, отделяет от себя тех своих членов, которые не согласны с ней в каких то вопросах вероучения. Анафема как бы говорит другим членам Церкви : «Этот путь опасен!»     ','Праздник отмечаемый в воскресенье первой недели Великого поста. Праздник посвящен памяти победы православия над иконоборцами.  Во время этого праздника выставляются, в середине храма полукругом, на аналоях (высокие столики для икон) храмовые иконы. В этот день церковь анафематствует, отделяет от себя тех своих членов, которые не согласны с ней в каких то вопросах вероучения. Анафема как бы говорит другим членам Церкви : «Этот путь опасен!»     '),(1021,'Родительская суббота','Кроме вселенского поминовения усопших, совершаемых в субботы мясопустную и Троицкую, Церковь совершает панихиды и в субботние дни 2-й , 3-й  и 4-й  седмиц Великого поста. В отличии от Вселенских родительских суббот, эти субботы посвящены поминовению близких, так как во дни Великого Поста, невозможны обыкновенные ежедневные поминовения усопших','Кроме вселенского поминовения усопших, совершаемых в субботы мясопустную и Троицкую, Церковь совершает панихиды и в субботние дни 2-й , 3-й  и 4-й  седмиц Великого поста. В отличии от Вселенских родительских суббот, эти субботы посвящены поминовению близких, так как во дни Великого Поста, невозможны обыкновенные ежедневные поминовения усопших.'),(1022,'Неделя святителя Григория Паламы','Во второе воскресенье Великого поста Православная Церковь молитвенно отмечает память святителя Григория Паламы, архиепископа Фессалоникийского.','Во второе воскресенье Великого поста Православная Церковь молитвенно отмечает память святителя Григория Паламы, архиепископа Фессалоникийского приверженца сосредоточенной духовной молитвы — умному деланию. Опытное применение умного делания, требующее уединения и безмолвия, получило название исихазма, а сами практикующие его стали называться исихастами.\r\n'),(1023,'Неделя Крестопоклонная','Третье воскресенье Великого поста. В храмах выносится крест для поклонения, что бы вспомнить страдания Христа и вдохновить на продолжение подвига поста.','Третье воскресенье Великого поста. В храмах выносится крест для поклонения, что бы вспомнить страдания Христа и вдохновить на продолжение подвига поста. Крест остается для поклонения в течении недели до пятницы, когда он, после часов, перед Литургией вносится обратно в алтарь. Поэтому третье воскресенье и четвертая седмица Великого поста называются \"крестопоклонными\".\r\n\r\n'),(1024,'Неделя Преподобного Иоанна Лествичника.','Воскресенье четвертой недели великого поста, православные вспоминают Преподобного Иоанна Лествичника, автора духовного творения, называемого \"Лествицей\" - классическое руководство в духовной жизни.','Воскресенье четвертой недели великого поста, православные вспоминают Преподобного Иоанна Лествичника, автора духовного творения, называемого \"Лествицей\" - классическое руководство в духовной жизни. Сочинение Иоанна Лествичника состоит из 30 слов, представляющей собой «ступени» добродетелей по которым христианин должен восходить на пути к духовному совершенству. \r\n'),(1025,'Мариино стояние.','Четверг пятой седмицы великого поста читается единственный раз в году целиком Великий канон святого Андрея Критского. Также на этой службе прочитывается житие Марии Египетской.','Четверг пятой седмицы великого поста читается единственный раз в году целиком Великий канон святого Андрея Критского. Также на этой службе прочитывается житие Марии Египетской.'),(1026,'Суббота акафиста','Суббота 5-й седмицы Великого поста. Особенностью этой субботы является торжественное пение на утрене Акафиста Божией Матери, посвященный Благовещению Пресвятой Богородицы и Воплощению Сына Божия.','Суббота 5-й седмицы Великого поста. Особенностью этой субботы является торжественное пение на утрене Акафиста Божией Матери, посвященный Благовещению Пресвятой Богородицы и Воплощению Сына Божия.'),(1027,'Неделя Преподобной Марии Египетской.','В четверг и воскресенье пятой седмицы великого поста вспоминается история Преподобной Марии Египетской. ','В четверг и воскресенье пятой седмицы великого поста вспоминается история Преподобной Марии Египетской.'),(1028,'Лазарева суббота','Лазарева суббота - суббота перед вербным воскресением, шестой седмицы великого поста. Лазареву субботу хорошо посвятить размышлению о смерти, провести подготовку к смерти по св. Франциску Сальскому. В этот день православные вспоминают чудо воскрешения Христом праведного Лазаря. В Лазареву субботу разрешается икра, елей и вино.','Лазарева суббота - суббота перед вербным воскресением, шестой седмицы великого поста. Лазареву субботу хорошо посвятить размышлению о смерти, провести подготовку к смерти по св. Франциску Сальскому. В этот день православные вспоминают чудо воскрешения Христом праведного Лазаря. В Лазареву субботу разрешается икра, елей и вино.'),(1029,'Мясопустная cедмица (пестрая).','Последняя неделя, когда разрешается есть мясо, кроме среды и пятницы. В эту неделю нужно уделить внимание внутренней подготовке к великому посту, т.к следующая за ней сырная седмица носит скорее праздничный характер.','Мясопустная седмица является подготовительной к Великому посту. В течение мясопустной седмицы ещё разрешается употреблять мясные продукты, кроме среды и пятницы, откуда происходит её другое именование «пёстрой». Пестрая седмица, в народных традициях упоминается как плохое время для бракосочетаний. В эту неделю нужно уделить внимание внутренней подготовке к великому посту, т.к следующая за ней сырная седмица носит скорее праздничный характер.\r\nМясопустная седмица в Древней Руси совпадала с Масленицей, языческим праздником проводов зимы, что в последствии породило путаницу в источниках, в которых смешивались понятия мясопустной и сырной седмицы (масленица). Следует знать что сырная и мясопустные седмицы - разные недели.\r\n'),(1030,'Страстная седмица.','Страстная седмица — последняя седмица Великого поста перед Пасхой. Она посвящена воспоминанию последних дней земной жизни Спасителя: Его страданий, крестной смерти и погребения (в церковнославянском языке слово «страсть» означает «страдание»). Все дни Страстной седмицы называются великими.','Страстная седмица — последняя седмица Великого поста перед Пасхой. Она посвящена воспоминанию последних дней земной жизни Спасителя: Его страданий, крестной смерти и погребения (в церковнославянском языке слово «страсть» означает «страдание»). Все дни Страстной седмицы называются великими. В эту седмицу следует усилить подвиг поста. Каждый день Страстной недели – великий и святой, и в каждый из них во всех церквях совершаются особые службы. Богослужения Страстной седмицы особо величественны, украшены мудро расположенными пророческими, апостольскими и евангельскими чтениями, возвышеннейшими, вдохновенными песнопениями и целым рядом глубоко знаменательных, благоговейных обрядов.'),(1031,'Страстная седмица','',''),(1032,'Страстной понедельник.','В Великий понедельник православные вспоминают притчи проклятие бесплодной смоковницы и  притчу о блаженном Иосифе, символизипующие отрекшиейся от веры народ и душу не приносящую духовных плодов покояния и любви ','В Великий понедельник православные вспоминают притчу проклятие бесплодной смоковницы и  притчу о блаженном Иосифе, символизирующие отрекшийся от веры народ и душу не приносящую духовных плодов покояния и любви.'),(1033,'Страстной вторник.','В Великий вторник воспоминается обличение Господом книжников и фарисеев, Его беседы и притчи, сказанные им в этот день в храме Иерусалимском: о дани кесарю, о воскресении мертвых, о Страшном суде, о десяти девах и о талантах.','В Великий вторник воспоминается обличение Господом книжников и фарисеев, Его беседы и притчи, сказанные им в этот день в храме Иерусалимском: о дани кесарю, о воскресении мертвых, о Страшном суде, о десяти девах и о талантах.'),(1034,'Страстная среда.','В Великую среду православные вспоминают предательство Иуды и помазание его блудницей. ','В Великую среду православные вспоминают два события предательство Иуды и помазание Господа блудницей. '),(1035,'Страстной четверг.','Великий четверг посвящен воспоминанию о Тайной вечере, на которой Христос омыл ноги ученикам своим, показав этим глубокий пример братской любви и смирения. Так же в этот день проводится уборка жилища, красятся яйца, пекут куличи. ','Великий четверг посвящен воспоминанию о Тайной вечере, на которой Христос омыл ноги ученикам своим, показав этим глубокий пример братской любви и смирения. В этот день проводится уборка жилища, красятся яйца, пекут куличи. '),(1036,'Страстная пятница.','Самый скорбный день года. Страстная пятница, так же носит названия Великая Пятница, Великий Пяток, посвящена воспоминаниям о распятии Иисуса, снятия его с креста и погребения. Великая пятница - день строго поста. Православные не употребляют пищу в течении дня. ','Самый скорбный день года. Страстная пятница, так же носит названия Великая Пятница, Великий Пяток, посвящена воспоминаниям о распятии Иисуса, снятия его с креста и погребения. Великая пятница - день строго поста. Православные не употребляют пищу в течении дня. '),(1037,'Страстная суббота.','Последний день страстной недели. Время умиротворения и гармонии, внутреннего ожидания воскрешения спасителя. В этот день вспоминаются пребывание Иисуса во гробу и сошествие Его в ад. В Великую Субботу в продолжение всего дня в храмах совершается освящение куличей, пасок и яиц.','Последний день страстной недели. Время умиротворения и гармонии, внутреннего ожидания воскрешения спасителя. Покой дня субботнего, не тоже самое, что безделие. Покой лишь внешнее проявление, т.к основная духовная работа в этот день уходит внутрь человека. В этот день вспоминаются пребывание Иисуса во гробу и сошествие Его в ад. В Великую Субботу в продолжение всего дня в храмах совершается освящение куличей, пасок и яиц.'),(1038,'Еженедельный пост.','Среда и пятница — постные дни в течение всего года (исключая сплошные седмицы и Святки, от Рождества Христова до Крещения, во время которых поста нет). ','Среда и пятница — постные дни в течение всего года (исключая сплошные седмицы и Святки, от Рождества Христова до Крещения, во время которых поста нет). В среду Церковь вспоминает предательство Иудой Христа, а в пятницу Его крестную смерть. По средам и пятницам в течение всей Пятидесятницы некоторыми монастырскими уставами дозволяется рыба, а другими - лишь растительное масло и вино. \r\nЕсли православный христианин не постится в Великий пост или по средам и пятницам в течение всего года, за исключением праздничных дней, то миряне по 69-му правилу святых апостолов отлучаются от причащения Святых Тайн, а священники извергаются. Послабление в посте допускаются для немощных , больных, престарелых...\r\nОснова поста — борьба с грехом через воздержание от пищи. Именно воздержание, а не изнурение тела, поэтому правила соблюдения постов каждый должен соизмерить со своими силами, со степенью своей подготовки к посту.\r\n'),(1039,'Рождественский сочельник','Последний день Рождественского поста. В этот день православные до первой звезды ничего не едят, а после употребляют в пищу сочиво - сушеные хлебные зерна, размоченные в воде.  ','Последний день Рождественского поста. В этот день православные до первой звезды ничего не едят, а после употребляют в пищу сочиво - сушеные хлебные зерна, размоченные в воде.  '),(1040,'Богоявленский сочельник','Канун великого праздника Крещения Господня. До первой звезды православные ничего не едят. После - едят сочиво - постное блюдо из вареных зерен пшеницы. В храмах освещается вода, которой следует окропить свое жилище. Ночью православные традиционно окунаются в прорубь, очищаясь от грехов. ','Сочельник - день особого духовного приготовления к торжеству Богоявления, как иначе называется праздник Крещения Господня.\r\nКанун великого праздника Крещения Господня. До первой звезды православные ничего не едят. После - едят сочиво - постное блюдо из вареных зерен пшеницы. В храмах освещается вода, которой следует окропить свое жилище. Ночью православные традиционно окунаются в прорубь, очищаясь от грехов. \r\nПосле обедни в Богоявленский сочельник в храмах совершается великое освящение воды, которое повторяется и в день праздника Крещения. Этой водой православным следует окропить свои жилища. А в ночь, кому под силу, следует совершать купание в прорубе.'),(1041,'Радоница.','Особый день поминовения усопших, именуемый по другому Пасхой для покинувших земную жизнь. ','Особый день поминовения усопших, именуемый по другому Пасхой для покинувших земную жизнь. На кладбище приносят крашенные яца, куличи, пироги, вино. Слово \"радоница\" образовано от слова радость и отмечалась христианами еще в древности. Радоница дает возможность понять православным, что не стоит углубляться в переживания по поводу утраты близких, а наоборот предлагает порадоваться их переходу в новую жизнь.'),(1042,'День поминовения всех погибших в годы Великой Отечественной войны.','Определением Архиерейского Собора Русской Православной Церкви 29 ноября – 4 декабря 1994 года установлено совершать в День Победы – 9 мая особое ежегодное поминовение усопших воинов, за веру, Отечество и народ жизнь свою положивших, и всех страдальчески погибших в годы Великой Отечественной войны 1941–1945 годов.','Определением Архиерейского Собора Русской Православной Церкви  установлено совершать в День Победы – 9 мая особое ежегодное поминовение усопших воинов, за веру, Отечество и народ жизнь свою положивших, и всех страдальчески погибших в годы Великой Отечественной войны 1941–1945 годов.'),(1043,'Троицкая вселенская родительская суббота','По Уставу Вселенской Православной Церкви накануне праздника Святой Пятидесятницы (Троицы) совершается заупокойное богослужение. Очень важно в этот день придти в храм Божий к началу Божественной литургии, подать записку с именами усопших и помолиться о их упокоении, или хотя бы поставить свечку.','По Уставу Вселенской Православной Церкви накануне праздника Святой Пятидесятницы (Троицы) совершается заупокойное богослужение. Очень важно в этот день придти в храм Божий к началу Божественной литургии, подать записку с именами усопших и помолиться о их упокоении, или хотя бы поставить свечку.\r\n	\r\n'),(1044,'Димитриевская суббота','В этот день, как и в другие родительские субботы православные молятся о упокоении душ близких и почитаемых православных. Но Димитриевская суббота несет в себе особый смысл - почитание воинов погибших на поле Куликовской битвы. ','В этот день, как и в другие родительские субботы православные молятся о упокоении душ близких и почитаемых православных. Но Димитриевская суббота несет в себе особый смысл - почитание воинов погибших на поле Куликовской битвы. \r\n'),(1045,'Дни святых','',''),(1046,'Апостола и евангелиста Иоанна Богослова','',''),(1047,'Святителя Николая, архиепископа Мир Ликийских, чудотворца','',''),(1048,'Неотсортированное','',''),(1049,'Неделя о Закхее-мытаре','',''),(1050,'Неделя 2-я по Пасхе (Антипасха). Воспоминание уверения ап. Фомы','',''),(1051,'Неделя 3-я по Пасхе, святых жен-мироносиц','',''),(1052,'Неделя 4-я по Пасхе, о расслабленном','',''),(1053,'Неделя 5-я по Пасхе, о самарянке','',''),(1054,'Неделя 6-я по Пасхе, о слепом','','<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\"><div style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; background-color: transparent; \"><font class=\"Apple-style