),(1162,'День иконы Божией Матери «Взыграние Младенца»','',''),(1163,'День собора Архистратига Михаила и прочих Небесных Сил бесплотных','',''),(1164,'День иконы Божией Матери «Скоропослушница»','',''),(1165,'День исповедника преподобного Феодора Студита','',''),(1166,'День Святого Иоанна Златоуста','',''),(1167,'Заговенье на Рождественский пост','',''),(1168,'День Святого Григория Паламы','',''),(1169,'День преподобного Паисия Величковского','',''),(1170,'День Святого апостола и евангелиста Матфея','',''),(1171,'День преподобного Никона Радонежского','',''),(1172,'День Святой великомученицы Екатерины','',''),(1173,'День священномученика Серафима','',''),(1174,'День Cвятого апостола Андрея Первозванного','',''),(1175,'День Святой Варвары','',''),(1176,'День Святого Николая Чудотворца','',''),(1177,'День преподобного Нила Столобенского','',''),(1178,'Зачатие праведной Анною Пресвятой Богородицы','',''),(1179,'День иконы Божией Матери «Нечаянная Радость»','',''),(1180,'День Святого епископа Иоасафа','',''),(1181,'День чудотворца Cвятого Спиридона Тримифунтского','',''),(1182,'День Памяти Пророка Аггея','',''),(1183,'День пророка Даниила и Святых отроков Анания, Азария и Мисаила','',''),(1184,'Мученики Адриан и Наталия','',''),(1185,'Дни особого поминовения усопших','',''),(1186,'footer_about','Шаблон информации о проекте. Располагается внизу - в футере. ','Каждый православный должен знать и помнить о важных событиях прошлого, ибо они влияют на будущее. Важно не просто помнить о ключевых датах православного календаря, но и знать как провести день этот с пользой для духа и не согрешить по незнанию своему.'),(1187,'error_mail_to_admin','Письмо админу, при ошибке','Внимание! произошла ошибка\r\n%message%\r\n------\r\n%params%'),(1188,'Что такое пост и как правильно поститься. ','','Как правильно поститься, что такое пост - это очень важные вопросы, ответы на которые должен знать верующий, прежде чем начнет практику поста. \r\nСовременный человек слаб перед своими желаниями, и не может противостоять им. \"А зачем мне от этого отказываться?!\", -скажет он и в очередной раз предастся праздности.  Здесь главное помнить, зачем верующий пришел в православие и помнить в чем цель и смысл практики поста. Говоря кратко - пост это практика укрепления и очищения духа, через отказ от праздности и увеселения. \r\nВ жизни возможны ситуации, когда потребуется крепость духа,придется принимать важные решения. Проявлять волю и собранность, противостоять серьезным трудностям - случается всем нам. И когда это случается, хочется быть готовым выдержать ниспосланные испытания. Как воспитать крепость духа? Возможности тренировки в обычной жизни предостаточно, и постящийся человек осознает это уже с первых дней поста. \r\n\r\nОснова поста - отказ от мясной пищи. И здесь уже можно столкнуться с внутренним сопротивлением. Человеческий ум устроен хитрым образом - даже если вы в своем обычном ритме жизни больше предпочитали овощи и мясо вы ели далеко не каждый день, то внезапный отказ вызовет в вас чувство противоречия. Вам захочется его есть в первый же день поста. Ум защищает привычный распорядок дня, а все что, нарушает его - воспринимается как угроза.  Повявляется искушение, и это замечательно. Именно в борьбе с искушениями и воспитывается дух. Кроме того, о мясной пище вам будут постоянно напоминать окружающие люди, которые не решились поститься. Вас неожиданно позовут в гости на застолье, или близкие друзья будут отмечать день рождения. Радуйтесь! Искушения - это возможности для духовного роста, ведь это и есть цель поста. \r\n\r\nКроме отказа от мясной пищи, постящиеся отказываются от употребления спиртного. Так же от обилия секса, увеселительных мероприятий и развлекательных телепрограмм. Это не значит, что нужно сидеть дома в заперти, это значит что нужно осознавать причины тяги к праздности и осознанно подходить к своему досугу, развиваться. Задумайтесь, если просмотр ТВ - это возможность просто-напросто \"убить время\" - откажитесь от этого. Если встречи с друзьями вам нужны только для того, чтобы заглушить внутреннюю пустоту - откажитесь от них во время поста. По возможности, привычный образ жизни должен быть пересмотрен во время поста. Степень отказа постящийся выбирает сам, ведь пост - это личная, индивидуальная практика. Не стоит повсеместно заявлять, что вы сейчас поститесь - это гордыня. Поститься следует внутренне, глубоко понимая суть происходящего, наблюдая искушения, наблюдая как возникают внутренние противоречия. Пост это внутренний подвиг. \r\n\r\nСледите за своими словами и мыслями во время поста. Пусть речь ваша будет осознанной. Не предавайтесь пустословию, пусть каждое сказанное слово несет смысл. Почувствуйте силу своих слов. Слова могут ранить, сильнее оружия, а могут и послужить началом нового. Но не забывайте, что слова - это лишь внешнее проявление вашего существа. Обратите внимание на то, о чем вы думаете. Какие мысли приходят вам в голову. Мысли всегда с вами - именно они и составляют основу вашей личности. Беспорядок в мыслях порождает беспорядок в жизни.  \r\n \r\n\"И что же делать, когда отказался от всего???\"- задаст вопрос неверующий. Но разве увеселения, мясная пища, вино -  все, что составляет жизнь? Это не так. Время поста - это время молитв, время общения с Богом. Просите в молитве сил для борьбы с искушениями, посещайте церковь. Читайте хорошие книги, посещайте те мероприятия, которые обогатят духовно, общайтесь с благостными людьми, занимайтесь спортом, гуляйте на природе, масса интересных занятий найдется для постящегося! Задумайтесь о своей жизни, созерцайте свои внутренние изменения. Пост - это время духовной работы. В мире много прекрасного, что можно увидеть, отказавшись от ненужной праздности. \r\n\r\nКонечно, наступает и тот момент ,когда время поста приходит к концу. Пост не может и не должен длится все время, наче он будет уже вреден. Полный аскетизм и отказ, зачастую -воспитание все той же гордыни. Когда заканчивается пост - не спешите бросаться во все, от чего отказались. Воздержавшись от пищи, мы можем вновь узнать ее забытый, истинный вкус. Это вкус даров Бога. Ограничив себя в поверхностостых мыслях, развлечениях, ненужных эмоциях - мы вновь можем осознать истинную суть человеческих отношений и вернуть наиболее правильный взгляд на вещи, до этого затуманенный повседневностью. Задумайтесь над тем, что дал вам пост и вы почувствете, как внутри что-то изменилось. Возможно вы избавились о чего-то, не нужного вашему существу. Это и есть очищение. <div><span class=\'alt\'>Семенов Валерий</span></div>'),(1189,'email_fogot_password','Письмо восстановление пароля. ','Для восстановления забытого пароля перейдите по ссылке в интерфейс и введите новый пароль.\r\n\r\nhttp://calendar.sancta.ru/user/settings/hash/%hash%/id/%id%'),(1190,'email_user_registration','Письмо, отравляемое пользователю при регистрации.','Добро пожаловать на сайт sancta.ru\r\n\r\nНа этом сайте Вы найдете информацию о праздиках и важных событиях в мире людей, идущих духовным путем и стремящихся к саморазвитию.\r\n\r\n\r\n'),(1191,'','',''),(1192,'','','');
