  `id` int(11) unsigned NOT NULL COMMENT 'object_id',
  `email` varchar(255) NOT NULL,
  `pass` varchar(33) DEFAULT NULL,
  `birthday` date DEFAULT NULL,
  `hash` varchar(33) DEFAULT NULL,
  `hash_create` datetime DEFAULT NULL,
  `gmt` int(100) DEFAULT NULL,
  `country_id` int(11) unsigned DEFAULT NULL,
  `region_id` int(11) unsigned DEFAULT NULL,
  `city_id` int(11) unsigned DEFAULT NULL,
  `mycity` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `NewIndex1` (`email`),
  KEY `FK_mf_system_user_country` (`country_id`),
  KEY `FK_mf_system_user_region` (`region_id`),
  KEY `FK_mf_system_user` (`city_id`),
  CONSTRAINT `FK_mf_system_user` FOREIGN KEY (`city_id`) REFERENCES `mf_system_cities` (`city_id`),
  CONSTRAINT `FK_mf_system_user_country` FOREIGN KEY (`country_id`) REFERENCES `mf_system_countries` (`country_id`),
  CONSTRAINT `FK_mf_system_user_region` FOREIGN KEY (`region_id`) REFERENCES `mf_system_regions` (`region_id`),
  CONSTRAINT `FK_systemUserId_systemObjectId` FOREIGN KEY (`id`) REFERENCES `mf_system_object` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
